import React, { createContext, useState, useEffect, useContext } from 'react';
import { 
  systemService, 
  requirementService, 
  expectationService, 
  generationService, 
  validationService 
} from '../services/api';
import { useAuth } from './AuthContext';

// 创建Expeta上下文
const ExpetaContext = createContext();

// Expeta Provider组件
export const ExpetaProvider = ({ children }) => {
  const { isAuthenticated } = useAuth();

  // 系统统计数据
  const [stats, setStats] = useState({
    requirements: 0,
    expectations: 0,
    generations: 0,
    validations: 0
  });

  // 系统健康状态
  const [health, setHealth] = useState({
    status: 'unknown',
    services: {}
  });

  // 期望列表
  const [expectations, setExpectations] = useState([]);

  // 生成结果列表
  const [generations, setGenerations] = useState([]);

  // 验证结果列表
  const [validations, setValidations] = useState([]);

  // 加载状态
  const [loading, setLoading] = useState({
    stats: false,
    health: false,
    expectations: false,
    generations: false,
    validations: false
  });

  // 错误状态
  const [error, setError] = useState({
    stats: null,
    health: null,
    expectations: null,
    generations: null,
    validations: null
  });

  // 加载系统统计数据
  const loadStats = async () => {
    if (!isAuthenticated) return;

    setLoading(prev => ({ ...prev, stats: true }));
    setError(prev => ({ ...prev, stats: null }));

    try {
      const response = await systemService.getSystemStats();
      setStats(response.data);
    } catch (err) {
      setError(prev => ({ 
        ...prev, 
        stats: err.response?.data?.message || 'Failed to load system stats' 
      }));
      console.error('Error loading stats:', err);
    } finally {
      setLoading(prev => ({ ...prev, stats: false }));
    }
  };

  // 加载系统健康状态
  const loadHealth = async () => {
    if (!isAuthenticated) return;

    setLoading(prev => ({ ...prev, health: true }));
    setError(prev => ({ ...prev, health: null }));

    try {
      const response = await systemService.getSystemHealth();
      setHealth(response.data);
    } catch (err) {
      setError(prev => ({ 
        ...prev, 
        health: err.response?.data?.message || 'Failed to load system health' 
      }));
      console.error('Error loading health:', err);
    } finally {
      setLoading(prev => ({ ...prev, health: false }));
    }
  };

  // 加载期望列表
  const loadExpectations = async () => {
    if (!isAuthenticated) return;

    setLoading(prev => ({ ...prev, expectations: true }));
    setError(prev => ({ ...prev, expectations: null }));

    try {
      const response = await expectationService.getExpectations();
      setExpectations(response.data);
    } catch (err) {
      setError(prev => ({ 
        ...prev, 
        expectations: err.response?.data?.message || 'Failed to load expectations' 
      }));
      console.error('Error loading expectations:', err);
    } finally {
      setLoading(prev => ({ ...prev, expectations: false }));
    }
  };

  // 加载生成结果列表
  const loadGenerations = async () => {
    if (!isAuthenticated) return;

    setLoading(prev => ({ ...prev, generations: true }));
    setError(prev => ({ ...prev, generations: null }));

    try {
      const response = await generationService.getGenerationHistory();
      setGenerations(response.data);
    } catch (err) {
      setError(prev => ({ 
        ...prev, 
        generations: err.response?.data?.message || 'Failed to load generations' 
      }));
      console.error('Error loading generations:', err);
    } finally {
      setLoading(prev => ({ ...prev, generations: false }));
    }
  };

  // 加载验证结果列表
  const loadValidations = async () => {
    if (!isAuthenticated) return;

    setLoading(prev => ({ ...prev, validations: true }));
    setError(prev => ({ ...prev, validations: null }));

    try {
      const response = await validationService.getValidationHistory();
      setValidations(response.data);
    } catch (err) {
      setError(prev => ({ 
        ...prev, 
        validations: err.response?.data?.message || 'Failed to load validations' 
      }));
      console.error('Error loading validations:', err);
    } finally {
      setLoading(prev => ({ ...prev, validations: false }));
    }
  };

  // 处理需求（完整流程）
  const processRequirement = async (text) => {
    try {
      const response = await requirementService.processRequirement(text);

      // 刷新数据
      loadStats();
      loadExpectations();
      loadGenerations();
      loadValidations();

      return response.data;
    } catch (err) {
      console.error('Error processing requirement:', err);
      throw err;
    }
  };

  // 仅澄清需求
  const clarifyRequirement = async (text) => {
    try {
      const response = await requirementService.clarifyRequirement(text);

      // 刷新期望列表
      loadExpectations();
      loadStats();

      return response.data;
    } catch (err) {
      console.error('Error clarifying requirement:', err);
      throw err;
    }
  };

  // 根据期望生成代码
  const generateCode = async (expectationId) => {
    try {
      const response = await generationService.generateCode(expectationId);

      // 刷新生成列表
      loadGenerations();
      loadStats();

      return response.data;
    } catch (err) {
      console.error('Error generating code:', err);
      throw err;
    }
  };

  // 验证代码
  const validateCode = async (generationId, expectationId) => {
    try {
      const response = await validationService.validateCode(generationId, expectationId);

      // 刷新验证列表
      loadValidations();
      loadStats();

      return response.data;
    } catch (err) {
      console.error('Error validating code:', err);
      throw err;
    }
  };

  // 当认证状态变化时，加载数据
  useEffect(() => {
    if (isAuthenticated) {
      loadStats();
      loadHealth();
      loadExpectations();
      loadGenerations();
      loadValidations();
    }
  }, [isAuthenticated]);

  // 提供的上下文值
  const value = {
    stats,
    health,
    expectations,
    generations,
    validations,
    loading,
    error,
    loadStats,
    loadHealth,
    loadExpectations,
    loadGenerations,
    loadValidations,
    processRequirement,
    clarifyRequirement,
    generateCode,
    validateCode
  };

  return <ExpetaContext.Provider value={value}>{children}</ExpetaContext.Provider>;
};

// 自定义hook，方便获取Expeta上下文
export const useExpeta = () => {
  return useContext(ExpetaContext);
};

export default ExpetaContext;
